Defendant Johnathon D Willis in court, in custody, with attorney M. Elizabeth Weathers.   Lesli S Boese appeared for the State of Wisconsin.

Plea Colloquy.

Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.  Count 2 and 3 are dismissed and read in.  Count 4 is dismissed by operation of law.

The Court Orders the Following:

Imposed  Sentence of 

5 Years Imprisonment (Credit - 186 days )
- 2 Years of Initial Confinement
- 3 Years of Extended Supervision

Conditions of Extended Supervision:
- AODA Assessment and follow through with any treatment recommended;
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Perform  20 hours of community service each year of extended supervision with community service in the last year to be performed within the first 10 months of the last year;
- Operate a Motor Vehicle with a Valid Drivers License;
- Maintain/Obtain full time employment;
-Provide DNA sample if not yet provided  and pay surcharge.

FINE:  $2277.00  
DNA Surcharge: $250.00
BLOOD DRAW FEE:  $35.00 to be paid through Waukesha County Circuit Court to be forwarded to  Waukesha Police Department.
(To be paid as a condition of extended supervision at the rate of $75.00  per month commencing the 4th month of extended supervision and then $100.00 per month commencing the 10th month of supervision)

DL REVOCATION:  24 months.

IGNITITION INTERLOCK: 24 months.

Defendant to attend the Victim Impact Panel on: Within the first 6 months of release onto Extended Supervision

Defendant is eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given.
